$$.control.registerControl("rootPage",{template:'<div bn-control="breizbot.searchbar" \n\tbn-event="searchbarsubmit: onSearch"\n\tdata-placeholder="What are you looking for ?" \n\t></div>\n<div class="results w3-light-grey">\n\t<div bn-each="results">\n\t\t<div class="w3-card-2 item">\n\t\t\t<div class="link">\n\t\t\t\t<a bn-attr="{href: $scope.$i.url}" bn-html="$scope.$i.title" class="link" target="_blank"></a>\n\t\t\t\t\n\t\t\t</div>\n\t\t\t<div bn-html="$scope.$i.source" class="source"></div>\t\t\n\t\t\t<div bn-html="$scope.$i.desc" class="desc"></div>\t\n\t\t</div>\n\t</div>\n\t\n</div>\n',deps:["app.browser"],init:function(t,e){const s=$$.viewController(t,{data:{url:"about:blank",results:[],showClear:!1},events:{onSearch:async function(t,n){console.log("onSearch",n);const r=n.value;if(r.startsWith("https://")||r.startsWith("http://"))s.setData({results:[],url:r});else{const t=await e.search(r);s.setData({results:t,url:"about:blank"})}}}})}}),$$.service.registerService("app.browser",{deps:["breizbot.http"],init:function(t,e){return{search:function(t){return e.post("/search",{query:t})}}}});